import React from "react";

import MidleContentStyle from "./MidleContentStyle"

//import {MidleContentConsumer} from "../../../../providers/MidleContextProvider"

import {ListActiveConsumer} from "../../../../ListActiveContextProvider"

class MidleContent extends React.PureComponent {
    constructor(props) {
        super(props);
        this.state = {
          error: null,
          isLoaded: false,
        };
      }

      _showCard = (context) =>
      {
          return <h3>{context.activeObject.name ? context.activeObject.name : "MidleContent"}</h3>
      }

      render() {
        return (
            <MidleContentStyle>
              <ListActiveConsumer>
                  { context =>(
                    this._showCard(context)
                )}
              </ListActiveConsumer>
            </MidleContentStyle>
        )
      }
}


export default MidleContent;

//<h3>{context.activeObject.name ? context.activeObject.name : "MidleContent"}</h3>
